import React, {Component} from 'react';

import {Card} from 'react-bootstrap';
import MonkeyInfo from '../monkey-info/monkey-info.js';

class DisplayCard extends Component {

    render() {

    return (
      <Card style={{ width: '18rem' }}>
      	<Card.Img variant="top" src="/assets/image-CD.png" />
      	<Card.Body>
      		<Card.Text>{this.props.info.cardTitle}</Card.Text>
		    <Card.Title>Veggies es bonus vobis, proinde postulo essum magis kohlrabi</Card.Title>
		    <MonkeyInfo />
	  	</Card.Body>
      </Card>
    );
  } 
}


export default DisplayCard;
